g.script:

function text(text) {
  var helpbox = document.getElementById("tspan5704");
  helpbox.textContent = text;
}
var helptexts = {
  // Add values here to add help-texts. No HTML allowed.
  // A single line must be used - SVG is brk with multiline strings
  // "svg entity ID": "text on mouse over",
  // Omit comma if it's the last one in the list.
  "path4519": "Pause/Resume: Toggles between pausing the simulation and resuming it.",
  "path4523": "Render Options: Opens up a dialog box with render options. This is where you can change the view mode or customise your own.",
  "path4527": "Options: Opens up a dialog box with simulation options and game options that can be changed.",
  "path4531": "Sign In: Sign in to the server with a Powder Toy account. Register a new account from the official Powder Toy website if you do not have one.",
  "path4547": "Clear Simulation: Resets the simulation.",
  "path4551": "Tags: Shows a list of tags placed on the current save. Click it to add tags to the current save (requires signing in).",
  "path4567": "Vote down: Votes down the current save (requires siging in).",
  "path4571": "Vote up: Votes up the current save (requires siging in).",
  "path4587": "Save: Uploads your simulation to the server if you are signed in or hold Ctrl and click it to save it offline to your hard desk.",
  "path4607": "Reload Simulation: Reloads the current simulation. Right clicking the reload button will show information on the current save.",
  "path4603": "Browse: Opens up the save browser where you can find saves made by the community. Hold Ctrl and click it to browse your offline saves.",

  "path4743": "Category: An element category that contains a list of related elements.",
  "path4739": "Category: An element category that contains a list of related elements.",
  "path4639": "Category: An element category that contains a list of related elements.",
  "path4635": "Category: An element category that contains a list of related elements.",
  "path4631": "Category: An element category that contains a list of related elements.",
  "path4627": "Category: An element category that contains a list of related elements.",
  "path4623": "Category: An element category that contains a list of related elements.",
  "path4619": "Category: An element category that contains a list of related elements.",
  "path4615": "Category: An element category that contains a list of related elements.",
  "path4611": "Category: An element category that contains a list of related elements.",

  "path4747": "Left Click Element: The element you draw with when you left click. You can change it by left clicking a different element.",
  "path4763": "Right Click Element: The element you draw with when you right click. You can change it by right clicking a different element.",
  "path4779": "Middle Mouse Click Element: The element you draw with when you middle mouse click. You can change it by middle mouse clicking a different element.",
  "path4795": "Element: An element you can select to draw with.",
  "path4811": "Element: An element you can select to draw with.",
  "path4827": "Element: An element you can select to draw with.",
  "path4843": "Element: An element you can select to draw with.",

  "path4723": "Sand Effect: A quick option to show a nice texture on powders.",
  "path4707": "Draw Gravity Field: A quick option to make the game show gravity fields.",
  "path4691": "Draw Decorations: A quick option to show decorations.",
  "path4675": "Newtonian Gravity: A quick option to allow gravity generated by particles or tools to work.",
  "path4659": "Ambient Heat: A quick option to enable ambient heat mode, which allows heat to travel in the air.",
  "path4643": "Show Console: Opens up the console, which is where you can run commands to do various tasks in the game.",

  "path4859": "Framerate: Shows how many update cycles the game can do in a single second. FPS is short for Frames per Second.",
  "path4887": "Particle Count: Shows the number of particles in the simulation. Walls and signs do not count.",
  "path5055": "Particle Type: Shows the type of particle you are hovering over.",
  "path5039": "Ctype: Shows the secondary type or ctype of the particle you are hovering over. You need to press the D key to show it in the HUD.",
  "path4999": "Temperature: Shows the temperature of the particle you are hovering over.",
  "path4971": "Life: Shows the life value of the particle you are hovering over. You need to press the D key to show it in the HUD.",
  "path4943": "Tmp: Shows the Tmp value of the particles you are hovering over. You need to press the D key to show it in the HUD.",
  "path4915": "Pressure: Shows the air pressure of the spot you are hovering over.",
  "path5127": "Particle Index: Shows the index or ID of the particle you are hovering over. You need to press the D key to show it in the HUD.",
  "path5099": "X: Shows the X coordinate of where your mouse is from left to right. You need to press the D key to show it in the HUD.",
  "path5071": "Y: Shows the Y coordinate of where your mouse is from top to bottom. You need to press the D key to show it in the HUD.",
  "path5171": "Button Description: Shows basic information on the button you are hovering over.",
  "path5155": "Element Description: Shows basic information on the element you are hovering over. Read the wiki for more information on any element."
}

for (var key in helptexts) {
  var svgel = document.getElementById(key);
  if (!svgel)
    continue;
  svgel.setAttribute("style", svgel.attributes.style.value.replace("pointer-events:none;", "cursor:pointer;"));
  svgel.onmouseover = function(evt) {
    evt.target.setAttribute("style", evt.target.attributes.style.value.replace("fill-opacity:1", "fill-opacity:0.5"));
    text(helptexts[evt.target.id]);
  }
  svgel.onmouseout = function(evt) {
    evt.target.setAttribute("style", evt.target.attributes.style.value.replace("fill-opacity:0.5", "fill-opacity:1"));
  }
}
//
